package com.bijays.leetcode;

import java.util.HashMap;
import java.util.HashSet;
import java.util.Map;

public class Anagram {
    public static boolean isAnagram(String s, String t) {
        HashMap<Character, Integer> sMap = new HashMap<>();
        HashMap<Character, Integer> tMap = new HashMap<>();

        for (int i = 0; i < s.length(); i++) {
            if (!sMap.containsKey(s.charAt(i))) {
                sMap.put(s.charAt(i), 1);
            } else {
                sMap.put(s.charAt(i), sMap.get(s.charAt(i)) + 1);
            }
        }

        for (int j = 0; j < t.length(); j++) {
            if (!tMap.containsKey(t.charAt(j))) {
                tMap.put(t.charAt(j), 1);
            } else {
                tMap.put(t.charAt(j), tMap.get(t.charAt(j)) + 1);
            }
        }

        if (sMap.size() != tMap.size()) {
            return false;
        }

        for (Map.Entry<Character, Integer> sm : sMap.entrySet()) {
            if (!tMap.containsKey(sm.getKey())) {
                return false;
            } else {
                if (!tMap.get(sm.getKey()).equals(sm.getValue())) {
                    return false;
                }
            }
        }

        return true;
    }

    public static boolean isAnagram2(String s, String t){
        if (s.length() != t.length()) {
            return false;
        }
        int[] counter = new int[26];
        for (int i = 0; i < s.length(); i++) {
            counter[s.charAt(i) - 'a']++;
            counter[t.charAt(i) - 'a']--;
        }
        for (int count : counter) {
            if (count != 0) {
                return false;
            }
        }
        return true;
    }

    public static void main(String[] args) {
//        String val1 = "";
//        String val2 = "";
        String val1 = "aa bb";
        String val2 = "ab ab";
        System.out.println(isAnagram(val1, val2));
    }
}
